import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    const initialShot = path.join(screenshotsDir, 'step_1_initial.png');
    await page.screenshot({ path: initialShot });
    screenshots.push(initialShot);

    // Wait for the price filter section using its heading text as anchor
    await page.waitForSelector('text=Price Range', { timeout: 5000 });

    // Locate the min and max price inputs using their placeholder attributes
    const minInput = await page.waitForSelector('input[placeholder="Min"]', { timeout: 5000 });
    const maxInput = await page.waitForSelector('input[placeholder="Max"]', { timeout: 5000 });

    // Clear and enter new price range values
    await minInput.click({ clickCount: 3 });
    await minInput.fill('100');
    await maxInput.click({ clickCount: 3 });
    await maxInput.fill('500');

    // Take screenshot after filling price fields
    const filledShot = path.join(screenshotsDir, 'step_2_filled_price.png');
    await page.screenshot({ path: filledShot });
    screenshots.push(filledShot);

    // Locate and click the "Apply" button using its class and text
    const applyBtn = await page.waitForSelector('button.apply-filter', { timeout: 5000 });
    await applyBtn.click();

    // Wait for a notification or filtered product grid/list to update
    // We'll wait for a notification with class ".notification.show"
    await page.waitForSelector('.notification.show', { timeout: 5000 }).catch(() => {});

    // Take screenshot after applying filter
    const appliedShot = path.join(screenshotsDir, 'step_3_applied_filter.png');
    await page.screenshot({ path: appliedShot });
    screenshots.push(appliedShot);

    // Extract the current min and max price values from the inputs for verification
    const minValue = await page.$eval('input[placeholder="Min"]', el => el.value);
    const maxValue = await page.$eval('input[placeholder="Max"]', el => el.value);

    // Optionally, extract the count of products displayed after filter
    let productCount = 0;
    // Try grid view first
    const gridProducts = await page.$$('.products-grid .product-card');
    if (gridProducts.length > 0) {
      productCount = gridProducts.length;
    } else {
      // Try list view
      const listProducts = await page.$$('.products-list .product-card-list');
      productCount = listProducts.length;
    }

    return {
      success: true,
      action: "Applied price range filter (100 to 500) and verified filter UI update",
      extractedData: {
        minPrice: minValue,
        maxPrice: maxValue,
        productCount
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
